// AdminPage.js - Trang Qu·∫£n tr·ªã: Th√™m phim m·ªõi
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const API_URL = 'http://localhost:5000/api/movies';

const AdminPage = () => {
  const [phimMoi, setPhimMoi] = useState({
    title: '', genre: '', director: '', main_actor: '', duration: '', language: '',
    country: '', release_date: '', description: '', subtitle: '', age: '', content: '',
    image: null, video: null
  });
  const dieuHuong = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    const role = localStorage.getItem('role');
    if (!token || role !== 'Admin') dieuHuong('/');
  }, [dieuHuong]);

  const xuLyThayDoi = (e) => {
    const { name, value, files } = e.target;
    setPhimMoi(prev => ({
      ...prev,
      [name]: files ? files[0] : value
    }));
  };

  const guiLenMayChu = async () => {
    const token = localStorage.getItem('token');
    const formData = new FormData();
    Object.entries(phimMoi).forEach(([key, val]) => {
      if (val) formData.append(key, val);
    });

    try {
      const res = await fetch(API_URL, {
        method: 'POST',
        headers: { Authorization: `Bearer ${token}` },
        body: formData
      });
      const data = await res.json();
      if (res.ok) {
        alert('‚úÖ Th√™m phim th√†nh c√¥ng!');
        setPhimMoi({
          title: '', genre: '', director: '', main_actor: '', duration: '', language: '',
          country: '', release_date: '', description: '', subtitle: '', age: '', content: '',
          image: null, video: null
        });
      } else {
        alert(data.error || '‚ùå L·ªói khi th√™m phim!');
      }
    } catch (err) {
      alert('‚ùå Kh√¥ng th·ªÉ k·∫øt n·ªëi ƒë·∫øn m√°y ch·ªß.');
    }
  };

  return (
    <div className="container py-4">
      <h2 className="mb-4 text-primary">üé¨ Trang Qu·∫£n Tr·ªã - Th√™m Phim M·ªõi</h2>

      <div className="row g-2">
        {['title', 'genre', 'director', 'main_actor', 'duration', 'language', 'country'].map((truong, i) => (
          <div className="col-md-6" key={i}>
            <input
              className="form-control mb-2"
              name={truong}
              placeholder={`Nh·∫≠p ${truong.replace('_', ' ')}`}
              value={phimMoi[truong] || ''}
              onChange={xuLyThayDoi}
            />
          </div>
        ))}

        <div className="col-md-6">
          <label className="form-label">Ng√†y kh·ªüi chi·∫øu</label>
          <input
            type="date"
            className="form-control mb-2"
            name="release_date"
            value={phimMoi.release_date}
            onChange={xuLyThayDoi}
          />
        </div>

        {['subtitle', 'age'].map((truong, i) => (
          <div className="col-md-6" key={i}>
            <input
              className="form-control mb-2"
              name={truong}
              placeholder={`Nh·∫≠p ${truong === 'subtitle' ? 'ph·ª• ƒë·ªÅ' : 'ƒë·ªô tu·ªïi'}`}
              value={phimMoi[truong]}
              onChange={xuLyThayDoi}
            />
          </div>
        ))}

        {['description', 'content'].map((truong, i) => (
          <div className="col-12" key={i}>
            <textarea
              className="form-control mb-2"
              name={truong}
              placeholder={`Nh·∫≠p ${truong === 'description' ? 'm√¥ t·∫£' : 'n·ªôi dung phim'}`}
              value={phimMoi[truong]}
              onChange={xuLyThayDoi}
              rows={2}
            />
          </div>
        ))}

        <div className="col-md-6">
          <label className="form-label">·∫¢nh Poster</label>
          <input
            type="file"
            className="form-control mb-2"
            name="image"
            accept="image/*"
            onChange={xuLyThayDoi}
          />
        </div>
        <div className="col-md-6">
          <label className="form-label">Video Trailer</label>
          <input
            type="file"
            className="form-control mb-2"
            name="video"
            accept="video/*"
            onChange={xuLyThayDoi}
          />
        </div>
      </div>

      <button className="btn btn-success mt-3" onClick={guiLenMayChu}>
        ‚ûï Th√™m phim
      </button>
    </div>
  );
};

export default AdminPage;
